Odd Jobs (NEW 2014 Wicked Pictures) (Split Scenes)

Brooklyn Chase, Holly Michaels, Kaylynn, Lizz Tayler, Veronica Avluv, Toni Ribas, James Deen, Mick Blue, Will Powers, and Xander Corvus

In this Sexually charged &quot;mockumentary&quot;, we follow the exploits of A Slightly Deceptive headhunter, Natalie (Brooklyn Chase), WHO Finds highly qualified people - 'less than' quality jobs. Whether it's a Babysitter, French Maid, Vacuum Salesman or Student Mover, all of the candidates bend over backwards to do their deeds! Odd Jobs ... because everyone deserves a raise!

